arrangement.p:
The collection is arranged into 14 series: 1. Administrative Files;		
2. Alumnae Council Files; 3. Alumni Club Files; 4. Alumni Societies; 		
5. Classes and Reunions; 6. Class Officer and District Files; 7. Class Reunion Files; 			
8. Scrapbooks, Registers and Accounts; 9. Society of Alumni; 10. Special Projects and Topics; 11. Topical Files; 12. Audio-Visual Materials; 13. Photographs; 14. Publications.
